import axios from 'axios'
const baseUrl = "http://localhost:8000"



export async function sendMenssage(information){

try {
    const response=await axios({
        url:`${baseUrl}/contactanos/`,
        method: 'POST',
        data: information,
    })
    console.log('exito')
    return response
} catch (e) {
    console.log('Fail')
    console.log(e)
}
}
